import React from 'react';
import { Button, Text } from './styles.js';

export default function ButtonConvert() {
    return (
        <div className="form-group">
            <Button>
                <Text>
                    <button type="button" class="btn btn-danger">Convert</button>
                </Text>
            </Button>
        </div>
    );
}
